import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // IG_REG_003: Test registration/essential elements presence and basic interaction

    // Wait for main search input and type a query
    await page.waitForSelector('#mainSearchInput', { timeout: 5000 });
    await page.click('#mainSearchInput');
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.type('#searchInput', 'emma');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_modal.png'));

    // Wait for and click the first 'Follow' button in suggestions
    await page.waitForSelector('.follow-btn', { timeout: 5000 });
    const followButtons = await page.$$('.follow-btn');
    if (followButtons.length > 0) {
      await followButtons[0].click();
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_follow_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_follow_clicked.png'));

    // Toggle private account checkbox
    await page.waitForSelector('#privateAccountToggle', { timeout: 5000 });
    const isChecked = await page.$eval('#privateAccountToggle', el => el.checked);
    if (!isChecked) {
      await page.click('#privateAccountToggle');
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_private_account_toggle.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_private_account_toggle.png'));

    // Type a comment and click 'Post'
    await page.waitForSelector('#commentInput', { timeout: 5000 });
    await page.fill('#commentInput', 'This is a test comment!');
    await page.waitForSelector('#postCommentBtn', { timeout: 5000 });
    await page.click('#postCommentBtn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_post_comment.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_post_comment.png'));

    // Toggle notifications checkbox
    await page.waitForSelector('#notificationsToggle', { timeout: 5000 });
    const notifChecked = await page.$eval('#notificationsToggle', el => el.checked);
    if (!notifChecked) {
      await page.click('#notificationsToggle');
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_notifications_toggle.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_notifications_toggle.png'));

    // Click the "Create" nav button and interact with file input (open modal, simulate file selection)
    await page.waitForSelector('.nav-item.create-btn', { timeout: 5000 });
    await page.click('.nav-item.create-btn');
    await page.waitForSelector('.select-computer-btn', { timeout: 5000 });
    // Simulate file upload (no real file, just focus/click for presence)
    await page.click('.select-computer-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_create_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_create_modal.png'));

    // Extract data to verify essential elements
    const extractedData = {
      searchInputPresent: await page.$('#searchInput') !== null,
      fileInputPresent: await page.$('#fileInput') !== null,
      commentInputPresent: await page.$('#commentInput') !== null,
      storyFileInputPresent: await page.$('#storyFileInput') !== null,
      chatInputPresent: await page.$('#chatInput') !== null,
      privateAccountChecked: await page.$eval('#privateAccountToggle', el => el.checked),
      notificationsChecked: await page.$eval('#notificationsToggle', el => el.checked),
      followBtnText: await page.$eval('.follow-btn', el => el.textContent.trim()),
      commentInputValue: await page.$eval('#commentInput', el => el.value),
      navHomePresent: await page.$('.nav-item.home-btn') !== null,
      navMessagesPresent: await page.$('.nav-item.messages-btn') !== null,
      navCreatePresent: await page.$('.nav-item.create-btn') !== null,
      navExplorePresent: await page.$('.nav-item.explore-btn') !== null,
      navNotificationsPresent: await page.$('.nav-item.notifications-btn') !== null,
      navProfilePresent: await page.$('.nav-item.profile-btn') !== null
    };

    return {
      success: true,
      action: "Verified essential elements, performed search, toggled checkboxes, followed a user, posted a comment, and opened create modal.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
